import React from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";
import "./App.css";

export default function App() {
  return (
    <Router>
      <div>
        <Link to="/login">Login Page</Link>

        <Link to="/">Home</Link>
      </div>
    </Router>
  );
}
